      ref: "Usuario",
    },
    descripcion: String,
    precio: {
      type: Number,
      required: true,
    },
    stock: {
      type: Number,
      required: true,
      default: 0,
    },
  },
  {
    timestamps: false,
    autoCreate: false,
  }
);

module.exports = productoSchema;

